Cold Souls (2009)  

Verenigde Staten
Drama / Komedie
97 minuten

geregisseerd door Sophie Barthes
met Paul Giamatti, Emily Watson en David Strathairn

Paul (Paul Giamatti) is een Amerikaanse acteur die zich midden in een bestaanscrisis bevindt. Dan raakt hij betrokken bij een laboratorium in New York, 'Soul Storage' genaamd. 'Soul Storage' biedt klanten die levensmoe zijn op bijzondere wijze verlichting.


